/** Constructs a new ModifiableSolrParams, copying values from an existing SolrParams */
public ModifiableSolrParams(SolrParams params)
{
  vals = new LinkedHashMap<String, String[]>();
  if( params != null ) {
    this.add( params );
  }
}

